// check for database existance
dbAccess.check()
.then((exists)=>{
    // if don't exist, create , then populate it
  if (!exists) {
    console.log(`.. create schema in ${dbAccess.DATABASE_FILE}`);
    return dbAccess.createSchema().then((_) => {
      console.log(".. database created");
      console.log(".. add data");
      return populateDatabase();
    }).then(_=>{
      console.log(".. database populated");
      console.log(".. create first backup");
      return dbAccess.makeHistory('database creation')
    });
  }
}).then((_) => {
  console.log(".. backup created");
  console.log(".. database ready");
  console.log(".. done");
  process.exit(0)
})
.catch((error) => {
  console.error('ERROR');
  console.error(error);
  console.log('anyway:');
  console.error('.. please check sqlite3 configuration');
  console.error('.. please check your version of python (2.7)');
  console.error('.. please check your version of windows studio (2015)');
  console.error('.. see readme for rebuild sqlite3');
  console.error(`delete ${dbAccess.DATABASE_FILE}`);
  console.error('.. then');
  console.error('re-run npm run create-database');

  process.exit(1)
});

