/**
 * Populate Database
 * @returns {Promise<void>}
 */
const populateDatabase = () => {
  /*
  here change the populate order and passe data in params
  header ; footer
  redirections
  in loop scopes (>id)
      > scope            |
      | config  <id      |
      |   > in loop rules|
      |   |------|   <id |
      |------------------|
  */
  return populateScopeTable()
    .then((_) => populateRedirectTypesTable())
    .then((_) => populateHeaderTable())
    .then((_) => populateFooterTable())
    .then((_) => populateScopesConfigTable())
    .then((_) => populateRulesTable())
    .then((_) => {
      console.log("db populated");
    });
};

/**
 * Populate RedirectTypes Table Table with Sample
 * @returns {Promise<RedirectType>}
 */
const populateRedirectTypesTable = () => {
  const redirectTypeArray = [
    {
      label: "permanent",
      value: "RedirectPermanent",
      code: "301",
    },
    {
      label: "temporaire",
      value: "RedirectTemp",
      code: "302",
    },
    {
      label: "permanent ExactMatch",
      value: "RedirectMatch 301",
      code: "301E",
    },
    {
      label: "temporaire ExactMatch",
      value: "RedirectMatch 302",
      code: "302E",
    },
  ];
  return dbAccess.insertRedirectTypes(redirectTypeArray);
};

